import axios from "axios";
import { useState } from "react";

function Command() {
  return (
    <div>
      <div className="mainAddMedicament">
        <div class="container d-flex align-items-center justify-content-center  pt-5">
          <form>
            <div class="row">
            <h1 class="text-center mt-2 mb-4">Order Information</h1>
              <div class="col-sm-6 ">
              <div class="mb-3 mt-3">
                  <label for="Name" class="form-label">
                    Name:
                  </label>
                  <input
                    type="text"
                    class="form-control"
                    id="nameMedicament"
                    placeholder="Enter name"
                    name="Name"
                    // value={med.nameMed}
                    // onChange={changeMed}
                  />
                </div>
                <div class="mb-3 mt-3">
                  <label for="Name" class="form-label">
                    User:
                  </label>
                  <input
                    type="text"
                    class="form-control"
                    id="nameMedicament"
                    placeholder="Enter name"
                    name="Name"
                    // value={med.nameMed}
                    // onChange={changeMed}
                  />
                </div>
                <div class="mb-3 mt-3">
                  <label for="weight" class="form-label">
                    Adress
                  </label>
                  <input
                    type="text"
                    class="form-control"
                    id="weightMedicament"
                    placeholder="Enter weight"
                    name="weight"
                    // value={med.weight}
                    // onChange={changeMed}
                  />
                </div>
              </div>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}

export default Command;
